(20, '', 'Crystal structures of insulin are remarkable for a long-range reorganization among three families of hexamers (designated T6, \r\nT\r\n3\r\nR\r\n3\r\nf\r\n, and R6). Although these structures are well characterized at atomic resolution, the biological implications of the TR transition remain the subject of speculation. Recent studies indicate that such allostery reflects a structural switch between distinct folding-competent and active conformations. Stereospecific modulation of this switch by corresponding d- and l-amino-acid substitutions yields reciprocal effects on protein stability and receptor-binding activity. Naturally occurring human mutations at the site of conformational change impair the folding of proinsulin and cause permanent neonatal-onset diabetes mellitus. The repertoire of classical structures thus foreshadows the conformational lifecycle of insulin in vivo. By highlighting the richness of information provided by protein crystallography', 'nsulin receptor substrate 3'),
